import React, { useState } from "react";
import '../Css/Signup.css';
//import img5 from '../image/img6.jpg';
import {NavLink , useHistory} from 'react-router-dom';



const Signup = () => {
  const History = useHistory();
  const [get, setGEt] = useState({
    name:"" ,
    email:"",
    phone:"",
    work:"",
    password:"",
    cpassword:""
  })
  let name, value;
  const handleInputs = (e) =>{
   name = e.target.name;
   value = e.target.value;

   setGEt({...get,[name]:value});
  }

const TransData = async (e ) =>{
  e.preventDefault();
  const { name,
  email,
  phone,
  work,
  password,
  cpassword } = get;

  const res = await fetch("/signup",{
    method: "POST",
    headers: {
      "Content-Type" : "application/json"
    },
    body:JSON.stringify({
   name,
  email,
  phone,
  work,
  password,
  cpassword
    })
  });

  const data = await res.json();
  if(res.status === 422 || !data){
    window.alert("invalid");
    console.log("invalid");
  }else{
    window.alert("success");
    console.log("successful");
    History.push("/login");
  }
}

    return (
      <>
      

<div className="main">
  
   <div className="col-xl-6 col-lg-6 col-md-6 col-s-6 leftimg">
      <p> <NavLink to="/Login">Create a Account</NavLink></p>
</div>
   <div className="col-xl-6  col-lg-6 col-md-6 col-s-6 rigtform">
     <h2>SignUp</h2>
     <form  method="POST">
       <div>
         <label></label>
         <input type="text" name="name" id="name" autoComplete="off" 
         value={get.name}
         onChange={handleInputs}
          placeholder="Enter Your Name"/>
       </div>
       <div>
         <label></label>
         <input type="Email" name="email" id="email" autoComplete="off" 
         value={get.email}
         onChange={handleInputs}
          placeholder="Email"/>
       </div>
       <div>
         <label></label>
         <input type="number" name="phone" id="phone no" autoComplete="off" 
         value={get.phone}
         onChange={handleInputs}
          placeholder="Phone no"/>
       </div>
       <div>
         <label></label>
         <input type="text" name="work" id="work" autoComplete="off" 
         value={get.work}
         onChange={handleInputs}
          placeholder="Profession"/>
       </div>
       <div>
         <label></label>
         <input type="password" name="password" id="password" autoComplete="off" 
         value={get.password}
         onChange={handleInputs}
          placeholder="Password"/>
       </div>
       <div>
         <label></label>
         <input type="password" name="cpassword" id="cpassword" autoComplete="off" 
         value={get.cpassword}
         onChange={handleInputs}
          placeholder="Confirm password"/>
       </div>
      
     </form>
     <div>
       <input type="submit" name="Submit" id="Submit" value="Register" className="stylebtn" 
       onClick={TransData}/>
       
     </div>
     <div className="social">
       <p> Sign In With</p>
       <button id="fb">Facebook</button>
       <button id="goo">Google</button>

     </div>
   </div>
   </div>
  


     
      </>

    );
  }
  
  export default Signup;
